	public static String[] getUuidsFrom(String packet) {
		XtReader rd = new XtReader(packet);
		rd.read();
		rd.read();
		rd.read();
		rd.read();
		int l = rd.readInt();

		ArrayList<String> ids = new ArrayList<String>();
		for (int i = 0; i < l; i++) {
			ids.add(rd.read());
			rd.read();
			rd.read();
		}
		return ids.toArray(t -> new String[t]);
	}

